This Tuesday, at a wholesale auction at the Tsukiji fish market in Tokyo, a 512-pound bluefin tuna was sold for $2.5 million. That's about $6,000 less on average than the $2,600 sold by another buyer in the same market at another time. (Sakai Yamagaya/Korea News Tribune via Reuters))<BR/
<BR>Japan's Prime Minister Shinzo Abe is expected to announce a new $10 billion stimulus budget this week in what is expected to turn the country from one of the world's most impoverished and vulnerable places toward a major economic boost. The $10 billion will be used primarily for infrastructure spending in the areas of education, education spending to boost health care and education spending;
